%[text] # Thin Wire Antenna Method of Moments
% Author: Alex Santiago Vargas
%
% Purdue University
% ECE 618: Numerical Electromagnetics

% Setup environment
clc; close all; % clear; % Clean up MATLAB
format shortEng; % Engineering number format
save = 0; % Save figures

% Define constants
epsilon_0=8.85418781e-12;       % [F/m] Permitivity of free space
mu_0=4*pi*1e-7;                 % [H/m] Permeability of free space
c0 = 1/sqrt(epsilon_0*mu_0);    % [m/s] Speed of light
eta0 = sqrt(mu_0/epsilon_0);    % [Ohm] Intrinsic impedance
%%
%[text] ## Settings
% Solver and geometry
freq = 3e9;         % [Hz] Frequency
lambda = c0/freq;         % [m] Wavelength
k0 = 2*pi/lambda;   % [1/m] Wavenumber

L = lambda/2;       % [m] Length of dipole
a = 1e-3*lambda;          % [m] Diameter of dipole
dz = lambda/60;             % Number of segments to simulate
%%
% Discretization
N = L/dz; % Calculate segment length

nodes = linspace(dz,L-dz,N-1)'; % Create nodes

% Initialize matrices
Z = zeros(N-1);
V = zeros(N-1,1);
V(N/2) = 1; % Set excitation at center

for m = 1:N-1
    % Get center of element m
    zm = nodes(m) + dz/2;
    for n = 1:N-1
        % Get center of element n
        zn = nodes(n) + dz/2;
        
        zmn_prime = dz/(2*pi)*(log(2*dz/a)-1) - 1j*k0/(4*pi)*dz^2; % Green's function result

        % Calculate distances between elements
        R = sqrt((zm-zn)^2 + a^2);
        rp = sqrt((zm-zn+dz)^2 + a^2);
        rm = sqrt((zm-zn-dz)^2 + a^2);

        % Calculate Green's function integral with basis functions
        G = dz^2 * exp(-1j*k0*R)/(4*pi*R);    % Triangular functions align
        Gp = dz^2 * exp(-1j*k0*rp)/(4*pi*rp); % Triagular functions overlap 1/2
        Gm = dz^2 * exp(-1j*k0*rm)/(4*pi*rm); % Triagular functions overlap -1/2

        % Calcuate Zmn terms
        Zmn_o = 0.25*1j*k0*eta0*G - 1j*(eta0/k0)*(1/dz^2)*G;
        Zmn_p = 0.25*1j*k0*eta0*Gp + 1j*(eta0/k0)*(1/dz^2)*Gp;
        Zmn_n = 0.25*1j*k0*eta0*Gm + 1j*(eta0/k0)*(1/dz^2)*Gm;
    

        Z(m,n) = 2*Zmn_o + Zmn_p + Zmn_n;
    end
end
J = Z\V;

% Calculate input impedance at feedpoint
Zin = V(N/2)/J(N/2) %[output:5eef1f79]
%%
%[text] ## Plot
figure() %[output:840e4c35]
    plot(nodes,abs(J)/max(abs(J)),'DisplayName','Amplitude') %[output:840e4c35]
    title('Current') %[output:840e4c35]
    xlabel('z [m]') %[output:840e4c35]
    ylabel('|I_z| [A]') %[output:840e4c35]
    pltAcademic(gcf,'display') %[output:840e4c35]
figure() %[output:5c3381ca]
plot(nodes,real(J)/1e-3,'DisplayName','\Re e(J)') %[output:5c3381ca]
    hold on; %[output:5c3381ca]
    plot(nodes(1:end),imag(J)/1e-3,'DisplayName','\Im m(J)') %[output:5c3381ca]
    title('Dipole Current') %[output:5c3381ca]
    xlabel('z [m]') %[output:5c3381ca]
    ylabel('Current [mA]') %[output:5c3381ca]
    legend() %[output:5c3381ca]
    grid on; %[output:5c3381ca]
%%
%[text] ## Far\-field
dB_min = -40; % Minimun normalized dB range for far-field plot
theta = (0:deg2rad(0.1):2*pi)'; % angles to sweep (theta is measured from z-axis)
E_theta = zeros(size(theta)); % E at Far-field
for i = 1:size(theta,1) % loop over each angle
    E_theta(i)=0;
    for j = 1:N-1 % Sum up the contribution of each element (mag and phase)
            E_theta(i) = E_theta(i) + dz*J(j)*sin(theta(i)) * exp(1j*k0*nodes(j)*cos(theta(i)));
    end
end

E_theta = 1j*eta0*E_theta/(4*pi); % Far field E
E_theta = abs(E_theta)/abs(max(E_theta)); % Normalized the results
MagE_dB = 10*log10(E_theta); % Convert to dB scale
MagE_dB(MagE_dB < dB_min) = dB_min; % Drop values below threshold (avoid -inf and inf issues)

% Plot farfield
figure  %[output:7bd8eb9a]
polarplot(theta, MagE_dB); %[output:7bd8eb9a]
rlim([dB_min max(MagE_dB)]) %[output:7bd8eb9a]
title('Antenna Pattern') %[output:7bd8eb9a]
%[text] 

